INSERT INTO `contents_page` VALUES (140,'Tentang Kami','<section class=\"h-spacing-below\">\r\n<p class=\"t-body\"><a href=\"http://themeforest.net/\">ThemeForest</a>&nbsp;is part of&nbsp;<a href=\"http://themeforest.net/community/market\">Envato Market</a>. At ThemeForest you can buy and sell HTML templates as well as themes for popular CMS products like WordPress, Joomla and Drupal. Items are priced on the complexity, quality and use of the file; the total price also includes a Buyer Fee. The site is home to a bustling community of web designers and developers and is the biggest marketplace of its kind.</p>\r\n</section>\r\n<section class=\"h-spacing-below\">\r\n<p class=\"t-body\">ThemeForest is more than a place to find great themes, it&rsquo;s a community! You can hear from authors, ask questions in&nbsp;<a href=\"https://forums.envato.com/\">the forums</a>, and comment on items. Contact fellow users and view their portfolios.&nbsp;<a href=\"http://marketblog.envato.com/\">Envato Market Blog</a>&nbsp;is a valuable resource for industry news, tips and tricks, and site updates.</p>\r\n<p class=\"t-body\">At ThemeForest we like to say that it is this community who really owns the site and we do our best to make sure they get the most out of it by providing not just great selling facilities but also interactivity, news, competitions and whatever else we can dream up!</p>\r\n<p class=\"t-body\">Plus ThemeForest is part of&nbsp;<a href=\"http://themeforest.net/community/market\">Envato Market</a>. Signing up to an account on ThemeForest will let you access the whole network</p>\r\n</section>','2015-11-05 06:21:49','2015-11-05 06:21:49',39,39,'tentang'),(141,'Hubungi Kami','<section class=\"h-spacing-below\">\r\n<p class=\"t-body\"><a href=\"http://themeforest.net/\">ThemeForest</a>&nbsp;is part of&nbsp;<a href=\"http://themeforest.net/community/market\">Envato Market</a>. At ThemeForest you can buy and sell HTML templates as well as themes for popular CMS products li